import "../../../src/App.css";
import React, { useContext } from "react";
import ProductItem from "../../components/mainpages/utils/productItem/ProductItem";
import { GlobalState } from "../../GlobalState";
import "../../pages/Products/Products.css";
import Divider from "@mui/material/Divider";
import CategoriesProducts from "./CategoriesProducts";
import CakeIcon from "@mui/icons-material/Cake";
import IconButton from "@mui/material/IconButton";
import { Link } from "react-router-dom";


export const Products = () => {
  const state = useContext(GlobalState);
  const [products] = state.productsApi.products;
  // console.log(products)
  // console.log(state)
  return (
    <>
      {/* <CategoriesProducts /> */}
      <div className="categoriasContainer">
        <div className="categoria1">
          <Link to="/" aria-label="Torta">
            <h1>Torta</h1>
            <IconButton aria-label="settings">
              <CakeIcon />
            </IconButton>
          </Link>
        </div>
        <div className="categoria2">Categoria 2</div>
        <div className="categoria3">Categoria 2</div>
        <div className="categoria4">Categoria 2</div>
        <div className="categoria5">Categoria 2</div>
      </div>

      <Divider variant="middle" />
      <div className="container_prod_filt">
        <div className="container_filt"> Filtros </div>
        <div className="container-prod">
          <h1 className="namePage"> Productos </h1>
          <div>⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀ </div>
          <Divider variant="middle" />

          <div className="products">
            {products.map((product) => {
              return <ProductItem key={product._id} product={product} />;
            })}
          </div>
        </div>
      </div>
      {/* {products.length === 0 && <Loading />} */}
    </>
  );
};
